import React from 'react';

const ViewProfile = () => {
  return (
    <div className="container mt-5">
      <h2>My Profile</h2>
      <p>Name: John Doe</p>
      <p>Email: john@example.com</p>
      <p>Role: CUSTOMER</p>
    </div>
  );
};
export default ViewProfile;
